import React, {Component} from 'react'
import logo from '../images/agiliad-logo.png'
import '../css/header.css';

export default class Header extends Component{
    constructor(props){
        super()
        this.state={
            employeeid :props.propObj.employeeid,
            emoyeename :props.propObj.emoyeename,
            gender :props.propObj.gender,
            skills :props.propObj.skills,
            tools :props.propObj.tools,
            domain :props.propObj.domain,
            experience :props.propObj.experience
        }
    }
    render(){
        return (
            <div className="header">
                <img className="logo" src={logo} alt="not found"></img>
                Employee Name :- {this.state.emoyeename} <br/>
                Employee Post :- {this.state.skills} <br/>
                Employee ID :- {this.state.employeeid} <br/>
            </div>
        )

    }
        
}
